import React, { useState, useEffect } from 'react';
import { getDatabase, ref, query, orderByChild, equalTo, get, set } from 'firebase/database';
import { getStorage, ref as storageRef, uploadBytes, getDownloadURL } from 'firebase/storage';

function Result() {
  const [type, setType] = useState('');
  const [resultData, setResultData] = useState([]);
  const [file, setFile] = useState(null);

  const handleTypeChange = (e) => {
    setType(e.target.value);
  };

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = () => {
    if (file) {
      const storage = getStorage();
      const storageReference = storageRef(storage, `files/${file.name}`);
      uploadBytes(storageReference, file).then((snapshot) => {
        getDownloadURL(snapshot.ref).then((url) => {
          const db = getDatabase();
          const newFileRef = ref(db, 'results').push();
          set(newFileRef, {
            type,
            url,
            name: file.name,
            uploadedAt: new Date().toISOString(),
          });
        });
      });
    }
  };

  useEffect(() => {
    if (type) {
      const db = getDatabase();
      const resultsRef = ref(db, 'results');
      const typeQuery = query(resultsRef, orderByChild('type'), equalTo(type));

      get(typeQuery)
        .then((snapshot) => {
          if (snapshot.exists()) {
            const data = snapshot.val();
            const formattedData = Object.keys(data).map((key) => data[key]);
            setResultData(formattedData);
          } else {
            setResultData([]);
          }
        })
        .catch((error) => console.error('Error fetching result data:', error));
    }
  }, [type]);

  return (
    <div>
      <h2>Results</h2>
      <div>
        <label>Select Type:</label>
        <select value={type} onChange={handleTypeChange}>
          <option value="">Select</option>
          <option value="internal">Internal</option>
          <option value="external">External</option>
          <option value="midterm">Midterm</option>
        </select>
      </div>
      <div>
        <label>Upload File:</label>
        <input type="file" onChange={handleFileChange} />
        <button onClick={handleUpload}>Upload</button>
      </div>
      {resultData.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>Type</th>
              <th>Name</th>
              <th>Uploaded At</th>
              <th>File</th>
            </tr>
          </thead>
          <tbody>
            {resultData.map((item, index) => (
              <tr key={index}>
                <td>{item.type}</td>
                <td>{item.name}</td>
                <td>{item.uploadedAt}</td>
                <td>
                  <a href={item.url} target="_blank" rel="noopener noreferrer">
                    View File
                  </a>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default Result;
